import axios from "axios";

export async function getAll() {
  let news;
  await axios.get("http://localhost:8080/api/news").then(
    (response) => {
      console.log(response);
      news = response.data.news;
    },
    (error) => {
      console.log(error);
    }
  );
  return news;
}
